import { loadState } from '../actions/stateActions';
import { FETCH_PHOTO } from '../actions/types';

const initialState = loadState();

export default function(state = initialState, action) {
    //console.log('here')
    switch(action.type) {
        case FETCH_PHOTO:
            return {
                ...state,
                photo: action.payload,
                loading: false
            }
        default:
            console.log('here')
            return state;
    }
}
